  `date` datetime DEFAULT NULL,
  `language` varchar(100) DEFAULT NULL,
  `firstclass` varchar(10) DEFAULT NULL,
  `cinema_id` varchar(30) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `film_id` varchar(50) DEFAULT NULL COMMENT 'Link to specific film',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=614 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
